import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { CssBaseline } from '@mui/material';
import { AuthProvider, useAuth } from './contexts/AuthContext.tsx';
import Navbar from './components/layout/Navbar.tsx';

// Pages
import LandingPage from './pages/LandingPage.tsx';
import ClientDashboard from './pages/ClientDashboard.tsx';
import AdminDashboard from './pages/AdminDashboard.tsx';
import Profile from './pages/Profile.tsx';
import Accounts from './pages/Accounts.tsx';
import Settings from './pages/Settings.tsx';
import Services from './pages/Services.tsx';
import AboutUs from './pages/AboutUs.tsx';
import Contact from './pages/Contact.tsx';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1A365D', // Deep navy blue - trust and stability
      light: '#2C5282',
      dark: '#0F2027',
      contrastText: '#ffffff',
    },
    secondary: {
      main: '#2D3748', // Charcoal gray - sophistication
      light: '#4A5568',
      dark: '#1A202C',
      contrastText: '#ffffff',
    },
    background: {
      default: '#F7FAFC', // Very light gray
      paper: '#ffffff',
    },
    text: {
      primary: '#1A202C',
      secondary: '#4A5568',
    },
    success: {
      main: '#38A169', // Professional green
      light: '#68D391',
      dark: '#2F855A',
    },
    warning: {
      main: '#D69E2E',
      light: '#F6E05E',
      dark: '#B7791F',
    },
    error: {
      main: '#E53E3E',
      light: '#FC8181',
      dark: '#C53030',
    },
    info: {
      main: '#3182CE',
      light: '#63B3ED',
      dark: '#2C5282',
    },
  },
  typography: {
    fontFamily: '"Inter", "Roboto", "Helvetica", "Arial", sans-serif',
    h1: {
      fontWeight: 800,
      color: '#1A202C',
      letterSpacing: '-0.02em',
    },
    h2: {
      fontWeight: 700,
      color: '#1A202C',
      letterSpacing: '-0.01em',
    },
    h3: {
      fontWeight: 600,
      color: '#1A202C',
    },
    h4: {
      fontWeight: 600,
      color: '#2D3748',
    },
    h5: {
      fontWeight: 600,
      color: '#2D3748',
    },
    h6: {
      fontWeight: 600,
      color: '#2D3748',
    },
    body1: {
      color: '#1A202C',
      lineHeight: 1.6,
    },
    body2: {
      color: '#4A5568',
      lineHeight: 1.5,
    },
  },
  shape: {
    borderRadius: 12,
  },
  components: {
    MuiCard: {
      styleOverrides: {
        root: {
          boxShadow: '0 4px 20px rgba(46, 125, 50, 0.1)',
          border: '1px solid rgba(46, 125, 50, 0.1)',
        },
      },
    },
    MuiButton: {
      styleOverrides: {
        root: {
          borderRadius: 8,
          textTransform: 'none',
          fontWeight: 600,
        },
        contained: {
          boxShadow: '0 2px 8px rgba(46, 125, 50, 0.3)',
          '&:hover': {
            boxShadow: '0 4px 12px rgba(46, 125, 50, 0.4)',
          },
        },
      },
    },
    MuiAppBar: {
      styleOverrides: {
        root: {
          backgroundColor: '#1B5E20',
          boxShadow: '0 2px 8px rgba(46, 125, 50, 0.2)',
        },
      },
    },
  },
});

const AppContent: React.FC = () => {
  const { isAdmin } = useAuth();

  return (
    <Router>
      <CssBaseline />
      
      <Routes>
        {/* Landing Page */}
        <Route path="/" element={<LandingPage />} />
        
        {/* Client Dashboard */}
        <Route path="/dashboard" element={<><Navbar /><ClientDashboard /></>} />

        {/* Admin Dashboard */}
        <Route path="/admin" element={<><Navbar /><AdminDashboard /></>} />

        {/* Profile Pages */}
        <Route path="/profile" element={<><Navbar /><Profile /></>} />
        <Route path="/accounts" element={<><Navbar /><Accounts /></>} />
        <Route path="/settings" element={<><Navbar /><Settings /></>} />

        {/* Public Pages */}
        <Route path="/services" element={<><Navbar /><Services /></>} />
        <Route path="/about" element={<><Navbar /><AboutUs /></>} />
        <Route path="/contact" element={<><Navbar /><Contact /></>} />

        {/* Fallback Route */}
        <Route
          path="*"
          element={
            <Navigate
              to="/"
              replace
            />
          }
        />
      </Routes>
    </Router>
  );
};

const App: React.FC = () => {
  return (
    <ThemeProvider theme={theme}>
      <AuthProvider>
        <AppContent />
      </AuthProvider>
    </ThemeProvider>
  );
};

export default App;
